import React, { useState, useEffect } from "react";
import { useNavigate } from 'react-router-dom';
import Manager_Product_List from "./Manager_Product_List";
import Manager_Add_Product from "./Manager_Add_Product";
import Manager_Orderding_List from "./Manager_Orderding_List";
import Manager_Profits from "./Manager_Profits";
import { Link, Outlet } from "react-router-dom"
import '../App.css';

export default function My_Manager(props) {
    const [mystyle, setMystyle] = useState({});
    useEffect(() => {
        setMystyle({
            color: "#3aedff",
            fontSize: "20px", marginLeft: "330px",
            marginTop: "70PX"
        });
    }, []);
    return (
    <div>
    <link rel="stylesheet" href="https://cdn.jsdelivr.net/npm/bootstrap@4.5.3/dist/css/bootstrap.min.css" integrity="sha384-TX8t27EcRE3e/ihU7zmQxVncDAy5uIKz4rEkgIXeMed4M0jlfIDPvg6uqKI2xXr2" crossorigin="anonymous"></link>
    <script src="https://code.jquery.com/jquery-3.5.1.min.js" integrity="sha256-9/aliU8dGd2tb6OSsuzixeV4y/faTqgFtohetphbbj0=" crossorigin="anonymous"></script>
    <script src="https://cdn.jsdelivr.net/npm/bootstrap@4.5.3/dist/js/bootstrap.min.js" integrity="sha384-w1Q4orYjBQndcko6MimVbzY0tgp4pWB4lZ7lr30WKz0vr/aWKhXdBNmNb5D92v7s" crossorigin="anonymous"></script>

        <div className="navbar navbar-expand-md">
            <nav id="navs ">
                <Link className="App-link navbar-brand" style={mystyle} to={`/manager/productlist`}>productlist</Link>
                <Link className="App-link navbar-brand" style={mystyle} to={`/manager/addProduct`}>addProduct</Link>
                <Link className="App-link navbar-brand" style={mystyle} to={`orderingList`}>orderingList</Link>
                <Link className="App-link navbar-brand" style={mystyle} to={`profits`}>profits</Link>
            </nav>
            <Outlet />
        </div>
        {/* <nav className="navbar navbar-expand-md">
            <a className="navbar-brand" href="#">Logo</a>
            <button className="navbar-toggler navbar-dark" type="button" data-toggle="collapse" data-target="#main-navigation">
                <span className="navbar-toggler-icon"></span>
            </button>
            <div className="collapse navbar-collapse" id="main-navigation">
                <ul className="navbar-nav">
                    <li className="nav-item">
                        <a className="nav-link" href="#">Home</a>
                    </li>
                    <li className="nav-item">
                        <a className="nav-link" href="#">About</a>
                    </li>
                    <li className="nav-item">
                        <a className="nav-link" href="#">Contact</a>
                    </li>
                </ul>
            </div>
        </nav> */}
    </div>);
}
